import React from 'react';
import { Link } from "react-router-dom";
const Recipes = (props) => {

    return (
        <div key={props.name}>

            <Link to={`/recipes/${props.dish}`}><img src={props.image} alt={props.name}/></Link>
            <p>{props.name}</p>

            <Link to={`/recipes/${props.dish}`}><button>{props.view}</button></Link>
        </div>
    )
};

export default Recipes;
